import api from './api';

const dashboardService = {
  getStats: async () => {
    const response = await api.get('/dashboard/stats');
    return response.data;
  },

  getChartData: async () => {
    const response = await api.get('/dashboard/chart/loans');
    return response.data;
  }
};

export default dashboardService;
